import { Link, Outlet } from "react-router-dom";

function Navbar() {
  return (
    <>
      <div className="nav">
          <Link to="/"><h4></h4>HOME</Link>
          <Link to="/about">ABOUT</Link>
          <Link to="/items">ITEMS</Link>

      </div>
      <Outlet/>
    </>
  );
}

export default Navbar;
